from typing import List

class Solution:
    # TLE on the long array!
    #def sortArrayByParityII(self, nums: List[int]) -> List[int]:
    #    # Re-arranging the array in-place.
    #    # Time complexity = O(N) ; Space complexity = O(1)
    #    for i in range(0, len(nums) - 1):
    #        if i%2 != nums[i]%2:
    #            for j in range(i+1, len(nums), 2):
    #                if j%2 != nums[j]%2:
    #                    # Swap elements at positions i and j
    #                    nums[i], nums[j] = nums[j], nums[i]
    #    return nums

    def sortArrayByParityII(self, nums: List[int]) -> List[int]:
        # Two pointer approach. Pointer i is on even indexes, j on odd indexes.
        i, j = 0, 1
        size = len(nums)
        while i < size and j < size:
            # If mismatch at location i, then check location j and either swap or move j
            if i%2 != nums[i]%2:
                #print(f'\tinside if...')
                if j%2 != nums[j]%2:
                    nums[i], nums[j] = nums[j], nums[i]
                    i += 2
                j += 2
            elif j%2 != nums[j]%2:
                #print(f'\tinside elif...')
                if i%2 != nums[i]%2:
                    nums[j], nums[i] = nums[i], nums[j]
                i += 2
            else:
                i += 2
                j += 2
        return nums

